function confirmDialog(n,t){$(`<div class="modal fade" id="confirmationModal" role="dialog" tabindex="-1" aria-hidden="true"> 
         <div class="modal-dialog modal-dialog-centered" role="document"> 
            <div class="modal-content"> 
                <div class="modal-header border-0">
                    <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                    </button>
                </div>
                <div class="modal-body border-0" style="padding:10px;"> 
                    <h5 class="text-center">${n}</h4> 
                </div> 
                <div class="modal-footer border-0">
                    <button type="button" class="btn btn-secondary btn-no" data-dismiss="modal">No</button>
                    <button type="button" class="btn btn-primary btn-yes">Yes</button>
                </div> 
           </div> 
        </div> 
      </div>`).appendTo("body");$("#confirmationModal").modal({backdrop:"static",keyboard:!0,focus:!0});$(".btn-yes").click(function(){t(!0);$("#confirmationModal").modal("hide")});$(".btn-no").click(function(){t(!1);$("#confirmationModal").modal("hide")});$("#confirmationModal").on("hidden.bs.modal",function(){$("#confirmationModal").remove()})}function addTextItemDialog(n,t){$(`<div class="modal fade" id="addTextModal" role="dialog" tabindex="-1" aria-hidden="true"> 
         <div class="modal-dialog modal-dialog-centered" role="document"> 
            <div class="modal-content"> 
                <div class="modal-header border-0">
                    <button type="button" class="close" data-dismiss="modal" aria-label="Close">
                        <span aria-hidden="true">&times;</span>
                    </button>
                </div>
                <div class="modal-body border-0" style="padding:10px;"> 
                    <h5>${n}</h5> 
                    <input type="text" id="modalTextInput" class="form-control mt-4"/>
                </div> 
                <div class="modal-footer border-0">
                    <button type="button" class="btn btn-secondary btn-no" data-dismiss="modal">Cancel</button>
                    <button type="button" class="btn btn-primary btn-yes btn-default">Add</button>
                </div> 
           </div> 
        </div> 
      </div>`).appendTo("body");$("#addTextModal").on("shown.bs.modal",function(){$("#modalTextInput").focus()});$("#addTextModal").modal({backdrop:"static",keyboard:!0,focus:!0});$(".btn-yes").click(function(){t($("#modalTextInput").val());$("#addTextModal").modal("hide")});$(".btn-no").click(function(){t(null);$("#addTextModal").modal("hide")});$("#addTextModal").on("hidden.bs.modal",function(){$("#addTextModal").remove()})}